var flashInterval;
var altFavIconHref;
var faveIconLink = [];
var urlRegex = new RegExp(/http(s)?:\/\/([\w+?\.\w+])+([a-zA-Z0-9\~\!\@\#\$\%\^\&amp;\*\(\)_\-\=\+\\\/\?\.\:\;\'\,]*)?/gi);

var setTabState = function(isDefault){
	var DEFAULT_TITLE = "Emerald";
	var NOTIF_TITLE = "New Notification";
	 if ( faveIconLink.length == 0 ){
		window.faveIconLink = $("#link_favicon");
	 }
	 if ( !altFavIconHref ){
		window.altFavIconHref = faveIconLink.attr("href");
	 }
	 if ( isDefault ){
		faveIconLink.attr("href", "favicon.ico");
		document.title = DEFAULT_TITLE;
	 } else {
		faveIconLink.attr("href", altFavIconHref);
		document.title = NOTIF_TITLE;
	 }
};

(function() {
  this.App = {};

  document.addEventListener('DOMContentLoaded', (function() {
    $('.tooltipped').tooltip({
      delay: 50
		});
		
		$(document).ready(function(){
			var hidden, visibilityState, visibilityChange;
			
			setTimeout(function(){ setTabState(true); }, 1000);

			window.focused = true;
	
			if (typeof document.hidden !== "undefined") {
				hidden = "hidden", visibilityChange = "visibilitychange", visibilityState = "visibilityState";
			} else if (typeof document.msHidden !== "undefined") {
				hidden = "msHidden", visibilityChange = "msvisibilitychange", visibilityState = "msVisibilityState";
			}
	
			var document_hidden = document[hidden];		
	
			document.addEventListener(visibilityChange, function() {
				if(document_hidden != document[hidden]) {
					if(document[hidden]) {
						// Document hidden
						focused = false;
					} else {
						// Document shown
						focused = true;
						clearInterval(flashInterval);						
						setTabState(true);
					}
	
					document_hidden = document[hidden];
				}
			});
		});

  }), false);

}).call(this);


App.serviceWorker = {}

/* Google Service Worker */
if ('serviceWorker' in navigator) {
  window.addEventListener('load', function() {
    navigator.serviceWorker.register('/sw.js').then((function(registration) {

      // success
			App.serviceWorker = registration;		

      console.log('ServiceWorker registration successful with scope: ', registration);
    }), function(err) {

      // fail
      console.log('ServiceWorker registration failed: ', err);
    });
  });
}
