var PayPal = {

  /* config
  **/
  currency: "USD",
  gold_price: 0.49,
  gold_transaction_id: "JMZEMEAGWNMG2",

  /* gold subscription
  **/
  gold_subscription: function() {

    // urls
    var create_payment_url = "/create_gold_subscription"
    var execute_payment_url = "/execute_gold_subscription"

    // render button
    paypal.Button.render({

      // config
      env: 'production', // production / sandbox
      commit: true,

      style: {
        color: 'gold',
        size: 'medium',
        shape: "pill",
        layout: "horizontal",
        fundingicons: true,
      },

      client: {
        sandbox: 'Aan6xtnZF3mV7097zLMYSF6a1DUwbwRdaLEuQdk7gJtZ-PTO3rnM_B5fXS6G-MWBsqc97ybNiscms6UA',
        production: 'AdH197i9hstzb6w1qKhfKFCCw7gWIuzyM8JmXb5xLT31j5JpsOSnkdC8J4GQQh5dDldoaUmI6ALol_l9'
      },

      funding: {
        allowed: [
          paypal.FUNDING.CREDIT,
          paypal.FUNDING.CARD,
          paypal.FUNDING.ELV
        ],
      },

      // initiate payment
      payment: function(data, actions) {
        return paypal.request.post(create_payment_url).then(function(data) {
          return data.id;
        });
      },

      // payment authorized
      onAuthorize: function(data, actions) {
        return paypal.request.post(execute_payment_url, data).then(function(p) {

          // purchased
          GoldBuyClient.setState({tab: "purchased"})
        });
      },

      // payment cancelled
      onCancel: function(data, actions) {
        console.log("cancelled")
      },

      // error
      onError: function(e) {
        console.log("error!", e)
      }
    }, '#paypal-button');
  }
}
