/* Simple WebRTC Client Interface */

App.webrtc = {

  /* Properties */
  client: null,
  stream: null,

  /* Initialize */
  init: function() {

    // new
    App.webrtc.client = new SimpleWebRTC({
      localVideoEl: 'localVideo',
      remoteVideosEl: 'remotesVideos',
      autoRequestMedia: true,
      audio: true,
      media: App.webrtc.get_media(),
      debug: false,
      url: "https://webrtc.emeraldchat.com:8888/"
    });

    /* Relay Mode Only (Disable this when not debugging TURN) */
    //App.webrtc.client.webrtc.config.peerConnectionConfig.iceTransports = "relay";

    /* Video Added */
    App.webrtc.client.on('videoAdded', function (video, peer) {
      console.log(peer, "# peer added #");

      // remove duplicates
      var incoming = []
      $('video').each(function() {
        var id = $(this).attr("id")
        if (id.includes("incoming")) {
          incoming.push($(this));
        }
      })
      for (var i=1; i < incoming.length; i++) {
        incoming[i].remove();
      }

      /* JQUERY */
      if (RoomClient.state.mode == "match_video") {
        $("#messages").addClass("room-component-video-messages-mobile")
      }

      /* Ice Server State */
      if (peer && peer.pc) {
        peer.pc.on('iceConnectionStateChange', function (event) {
            switch (peer.pc.iceConnectionState) {
            case 'checking':
                console.log("# ice : connecting to peer... #")
                break;
            case 'connected':
            case 'completed': // on caller side
                console.log("# ice : connection established... #")
                break;
            case 'disconnected':
                console.log("# ice : disconnected... #")
                break;
            case 'failed':
                break;
            case 'closed':
                console.log("# ice : connection closed... #")
                break;
            }
        });
      }
    });

    /* Video Removed */
    App.webrtc.client.on('videoRemoved', function (video, peer) {

      /* JQUERY */
      if (RoomClient.state.mode == "match_video") {
        $("#messages").removeClass("room-component-video-messages-mobile")
      }

      // remove duplicates
      $('video').each(function() {
        var id = $(this).attr("id")
        if (id.includes("incoming")) {
          $(this).remove()
        }
      })
    });

    /* Media Error */
    App.webrtc.client.on('localMediaError', function (err) {
      console.log(err, "ERROR, media not found")
    })

    /* Ice failed */
    App.webrtc.client.on('iceFailed', function (peer) {
      var pc = peer.pc;
      console.log('# ice failed : had local relay candidate #', pc.hadLocalRelayCandidate);
      console.log('# ice failed : had remote relay candidate #', pc.hadRemoteRelayCandidate);
    });

    /* Ice failed remote */
    App.webrtc.client.on('connectivityError', function (peer) {
      var pc = peer.pc;
      console.log('# connectivity error : had local relay candidate #', pc.hadLocalRelayCandidate);
      console.log('# connectivity error : had remote relay candidate #', pc.hadRemoteRelayCandidate);
    });
  },

  /* Join */
  join: function(room_id) {
    App.webrtc.client.on('readyToCall', function () {
      App.webrtc.client.joinRoom(room_id);
    });
  },

  /* Connect */
  connect: function(id) {
    App.webrtc.init()
    App.webrtc.join(id)
  },

  /* Disconnect */
  disconnect: function() {
    App.webrtc.client.leaveRoom(App.webrtc.client.roomName)
  },

  /* Switch */
  switch: function(id) {
    this.remove_partner_videos();
    App.webrtc.client.leaveRoom(App.webrtc.client.roomName)
    App.webrtc.client.joinRoom(id)
  },

  /* remove partner videos
  **/
  remove_partner_videos: function() {
    $('video').each(function() {
      var id = $(this).attr("id")
      if (id.includes("incoming")) {
        $(this).remove()
      }
    })
  },

  /* Get Media Mode */
  get_media: function() {

    /* Default */
    var audio;
    var video;

    return {
      audio: true,
      video: true
    }
  },

  /* Close Local Streams */
  close: function() {
    if (!App.webrtc.stream) {
      return
    }
    tracks = App.webrtc.stream.getTracks()
    for (var i = 0; i < tracks.length; i++) {
      tracks[i].stop()
    }
    App.webrtc.client.stopLocalVideo();
  },

  /* Media Compatibility */
  media_compatible: function(media) {
    return navigator.mediaDevices.getUserMedia(media).then(function(stream) {
      App.webrtc.compatible(media);
    }).catch(function(err) {
      console.log(err)
      App.webrtc.incompatible(media);
    });
  },

  /* On Compatible with media */
  compatible: function(media) {
    console.log("media is compatible", media)
  },

  /* On Incompatible with media */
  incompatible: function(media) {
    console.log("media is incompatible", media)
  },
};
